import Vue from "vue";
import VueRouter from "vue-router";
import HomeView from "../views/HomeView.vue";
import Login from "../views/login/LoginView.vue";
import AnalyseView from "../views/home/AnalyseView.vue";
import IndexView from "../views/home/form/indexView.vue";
import NewForm from "../views/home/form/NewView.vue";
import StepForm from "../views/home/form/StepFrom.vue";
import HigherForm from "../views/home/form/higherForm.vue";
import QueryList from "../views/home/list/QueryView.vue";
import StandardList from "../views/home/list/StandardView.vue"
Vue.use(VueRouter);
const originalPush = VueRouter.prototype.push; //修改原型对象中的push方法
VueRouter.prototype.push = function push(location) {
  return originalPush.call(this, location).catch((err) => err);
};

const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
    children: [
      {
        path: "/analyse",
        name: "analyse",
        component: AnalyseView,
      },
      {
        path: "/index",
        name: "index",
        component: IndexView,
      },
      {
        path: "/newForm",
        name: "newForm",
        component: NewForm,
      },
      {
        path: "/stepForm",
        name: "stepForm",
        component: StepForm,
      },
      {
        path: "/higherForm",
        name: "higherForm",
        component: HigherForm,
      },
      {
        path: "/queryList",
        name: "queryList",
        component: QueryList,
      },
      {
        path: "/standardList",
        name: "standardList",
        component: QueryList,
      },
    ],
  },
  {
    path: "/login",
    name: "login",
    component: Login,
  },
];

const router = new VueRouter({
  mode: "history",
  routes,
});

export default router;
